      out.write("\t\t\t\t\t\t\t\t국립민속박물관은 2021 신축년 정월 대보름을 맞아 “2021 신축년 정월 대보름맞이 한마당” 세시 행사를 운영한다. 이번 행사는 국립민속박물관 홈페이지, 유튜브 및 SNS를 통한 비대면 행사와 정월 대보름(2/26) 대면 행사로 진행된다. 정월 대보름을 맞아 집에서 가족과 함께 즐길 수 있는 ‘정월 대보름맞이 선물 꾸러미’ 이벤트는 2월 5일까지 신청 접수하며, ‘정월 대보름 소개 영상(신축년 정월대보름)’과 ‘온라인 특별공연(정월 대보름맞이 북청사자놀음, 전통타악 아작의 장구프리)’은 국립민속박물관 유튜브에서 2월 24일~26일 공개된다. 2월 26일 정월 대보름날에는 ‘풍년 기원 볏가릿대 세우기’와 ‘풍물 공연’, '짚풀 소 세우기'를 박물관에서 진행한다. 국립민속박물관에서 준비한 ‘정월 대보름맞이 한마당’을 통해 풍성한 정월 대보름을 보내시길 기원한다.\r\n");
